__NUXT_JSONP__("/improve", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t,u){return {data:[{document:{slug:"improve",description:"You can improve the masternetwork",title:"Improve the masternetwork",category:"Open source",position:4,toc:[{id:n,depth:g,text:o},{id:p,depth:g,text:q},{id:r,depth:g,text:s}],body:{type:"root",children:[{type:a,tag:h,props:{id:n},children:[{type:a,tag:e,props:{ariaHidden:i,href:"#how-can-i-improve-the-masternetwork-",tabIndex:j},children:[{type:a,tag:k,props:{className:[l,m]},children:[]}]},{type:b,value:o}]},{type:b,value:d},{type:a,tag:f,props:{},children:[{type:b,value:"The site, the user interface is open source. This means that anyone can try to improve it to make the experience more interesting for everyone. It is made with nuxtjs (vuejs) and is just an aesthetic way to interact with the api. "},{type:a,tag:c,props:{},children:[]},{type:a,tag:c,props:{},children:[]},{type:b,value:"\r\nSo you can add features, make the design more beautiful, better and submit your changes. If approved, they will be deployed quickly, allowing everyone to enjoy them."}]},{type:b,value:d},{type:a,tag:f,props:{},children:[{type:a,tag:"img",props:{src:"\u002Fsls.jpg"},children:[]},{type:a,tag:c,props:{},children:[]},{type:a,tag:c,props:{},children:[]}]},{type:b,value:d},{type:a,tag:h,props:{id:p},children:[{type:a,tag:e,props:{ariaHidden:i,href:"#the-masternetwork-is-mainly-an-api",tabIndex:j},children:[{type:a,tag:k,props:{className:[l,m]},children:[]}]},{type:b,value:q}]},{type:b,value:d},{type:a,tag:f,props:{},children:[{type:b,value:"The api is very sensitive and protected, so if you want to make changes it will be necessary to let us know on "},{type:a,tag:e,props:{href:t},children:[{type:b,value:u}]},{type:b,value:" which will allow us to provide you with an environment and possibly a part of the revenues of the masternetwork during a given period.\r\n"},{type:a,tag:c,props:{},children:[]},{type:a,tag:c,props:{},children:[]},{type:b,value:"\r\nIt could be great to add features like CDNs, a specialized cloud for storage, things like that.\r\nMake the user experience simple, like Netlify did for websites.\r\nThe network right now is just the beginning, you can easily add things on top of what is already built."}]},{type:b,value:d},{type:a,tag:h,props:{id:r},children:[{type:a,tag:e,props:{ariaHidden:i,href:"#the-documentation",tabIndex:j},children:[{type:a,tag:k,props:{className:[l,m]},children:[]}]},{type:b,value:s}]},{type:b,value:d},{type:a,tag:f,props:{},children:[{type:b,value:"If you want to write content, for documentation, tutorials ... It's totally possible ! This could help to make the masternetwork known to more people and you will be able to earn commissions on the expenses of new subscribers. If you are interested, join us on "},{type:a,tag:e,props:{href:t},children:[{type:b,value:u}]},{type:b,value:" and we will be happy to discuss.\r\nIt could be great to create tutorials on how to manage masternetwork infrastructures, create websites, mail servers, start complex applications...\r\nAt this moment, the documentation is not free access since I don't want the google robots to index the github pages which will be over the real documentation (as the domain is very recent). "},{type:a,tag:c,props:{},children:[]},{type:a,tag:c,props:{},children:[]},{type:b,value:"\r\nSo, if you want to improve the documentation, thank you very much, and then, just ask us for the github repository access. We'll give you access immediately!"}]}]},dir:"\u002Fen",path:"\u002Fen\u002Fimprove",extension:".md",createdAt:"2022-06-28T19:32:23.574Z",updatedAt:"2022-06-30T12:50:40.476Z",to:"\u002Fimprove"},prev:{title:"Installation",path:"\u002Fen\u002Finstallation",to:"\u002Finstallation"},next:{title:"Installation in a virtual machine",path:"\u002Fen\u002Finstallation-virtualize",to:"\u002Finstallation-virtualize"}}],fetch:{},mutations:[]}}("element","text","br","\n","a","p",2,"h2","true",-1,"span","icon","icon-link","how-can-i-improve-the-masternetwork-","How can i improve the masternetwork ?","the-masternetwork-is-mainly-an-api","The masternetwork is mainly an api","the-documentation","The documentation","https:\u002F\u002Fdiscord.com\u002Finvite\u002FNVvvkXMbAB","discord")));